import React from "react";
import { Link } from "react-router-dom";

const AdminSidebar = () => {
  return (
    <div
      className="sidebar d-flex flex-column w-25 bg-success min-vh-100 p-4"
      style={{ minWidth: "500px" }}
    >
      <Link to="/admin/dashboard" className="text-white mt-3">
        <i className="fas fa-tachometer-alt"></i> Dashboard
      </Link>
      <Link to="/admin/view-products" className="text-white mt-3">
        <i className="fas fa-box-open"></i> View Products
      </Link>
      <Link to="/admin/create-product" className="text-white mt-3">
        <i className="fas fa-plus-square"></i> Create Product
      </Link>
      <Link to="/admin/view-categories" className="text-white mt-3">
        <i className="fas fa-list"></i> View Categories
      </Link>
      <Link to="/admin/create-category" className="text-white mt-3">
        <i className="fas fa-plus-circle"></i> Create Category
      </Link>
    </div>
  );
};

export default AdminSidebar;
